import Filter from './components/filter/Filter'
import ProjectCard from './components/card/ProjectCard'
import inesctecLogo from '../../images/companies/inesc-tec_logo.png'
import './Projects.css'

function Projects() {
  return (
    <section id='projects' className='sectionBackground'>
      <section className='sectionContents'>
        <h2 className='sectionTitle'>Projects</h2>
        <Filter />
        <section id='projects-contents'>
          <ProjectCard 
            name='MaTheX2Java'
            brief='Web-app focused on a free andopen-source source-to-source compiler to translate latex mathematic equations to fully operation al Java code.'
            date='2019'
            imgSrc={inesctecLogo}
            alt='MaTheX2Java Logo'/>
        </section>
      </section>
    </section>
  );
}

export default Projects;
